main() {
  // Challenge 1
  // Print first 30 terms of Fibonnaci sequence
  // Fibonnaci sequence is generated by adding last two terms, here are first six terms for you
  // 1, 1, 2, 3, 5, 8
List Fibonnaci = [0];
int j =0;
int k=0;
int number;

for (int i = 1; Fibonnaci.length <= 30; i++){
    number = i + j + k;
    if ( i > 1){
      j++;
       if  (i > 2)  {
         k++;
       }
    }
    Fibonnaci.add(number);
  }
  print (Fibonnaci);
  for (int x in Fibonnaci) // Long List
  {
    print (x);
  }
}
